<?php

/**
 * get_results
 *
 * give back a json containing the results generated by the MixMHCp script
 *
 * @param string $result_id
 * @return json
 * @author Roman
 */

function get_results($result_id){
    $res = array('result_id' => $result_id, 'html_file' => $result_id.'/results/logos.html');
    return $res;
}


?>